import Web3 from 'web3';
import logo from './logo.svg';
import TokenMinter from './contracts/TokenMinter.json'
import './App.css';

class App extends Component {
  constructor() {
    super();
    const web3 = new Web3(new Web3.providers.HttpProvider("https://rinkeby.infura.io/v3/9b11910966d3430e9846e504d5847593"))
    const tokenMinterAddress = '0x19A5A6878e66e5E12F04114ca5ef8e94919Ac9C8'
    const tokenMinterContract = new web3.eth
      .Contract(TokenMinter.abi, tokenMinterAddress)
    tokenMinterContract.methods.getMintHistory().call().then(res => res.json()).then(json => console.log(json))
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
